const UploadPage = () => {
  return (
    <>
      <Header />
      <InputField />
      <TextArea
        className="upload-form__description"
        type="textbox"
        rows="4"
        placeholder="Add a description to your video"
      />
    </>
  );
};

export default UploadPage;
